import React from 'react'

function Silly() {

    let randomNumber

    function generateRandomNumber() {
        randomNumber = Math.floor(Math.random());
    }

    return (
        <div>
            <h1>
                {randomNumber}
            </h1>
            <button onClick={generateRandomNumber}>Generate Number</button>
        </div>
    )
}

export default Silly
